import React, { Component } from 'react'
import axios from 'axios'
import { Table } from 'reactstrap';

export default class PostList extends Component {

    constructor(props) {
        super(props)

        this.state = {
             post :[]
        }
    }

    componentDidMount(){
        axios.get('http://www.omdbapi.com/?s=hello&apikey=95632709')
        .then(response =>{
            console.log(response.data)
            this.setState({
                post : response.data.Search
            })
        })
        .catch(error =>{
            console.log(error)
        })
    }

    render() {
        return (
            <div>
                <label className="text-danger">Posts From API</label>
                <Table hover>
                    <thead>
                    <tr>
                        <th>ID</th>
                        <th>Title</th>
                        <th>Body</th>
                    </tr>
                    </thead>
                    <tbody>

                    {this.state.post.map(item =>
                        <tr>
                        <td key={item.imdbID}>{item.imdbID}</td>
                        <td key={item.Title}>{item.Title}</td>
                        <td key={item.Year}>{item.Year}</td>
                        </tr>
                    )}
                    </tbody>
                </Table>



            </div>
        )
    }
}
